import { Routes,Route } from "react-router-dom";
import { useState } from "react";

import {
  Home ,
  Upload
} from './screens';


function App() {

  return (
   <div>
      <Routes>
        <Route index element={<Home />}></Route>
        <Route path="/create" element={<Upload/>}/>
      </Routes>
   </div>
  )
}

export default App;
